const Title=()=>{
    const [num,setNum]=useState(0);
    useEffect(()=>{
        document.title = `my-app(${num})`
    });
    return(
        <div>
            {/* <h1>{num}</h1> */}
            <button onLoad={()=>setNum(num+1)}>click</button>
        </div>
    )
}
export default Title
